import React from 'react';
import {ReactDadata} from "react-dadata";

const CalculateForm =(props)=>{
    let items = [
        { id: 0, value: 'ruby' },
        { id: 1, value: 'javascript' },
        { id: 2, value: 'lua' },
        { id: 3, value: 'go' },
        { id: 4, value: 'julia' }
    ]
    return <div>
        <Search items={items} />
        }/>
    </div>
}
export default CalculateForm;
